import { getAddress as getAddress2 } from "viem";

// src/utils.ts
import { createPublicClient, http } from "viem";
import {
  arbitrum,
  arbitrumGoerli,
  avalanche,
  avalancheFuji,
  bsc,
  bscTestnet,
  mainnet
} from "viem/chains";
import { ChainId as ChainId5 } from "@traderjoe-xyz/sdk-core";
var getDefaultPublicClient = (chainId) => {
  const chain = getChain(chainId);
  return createPublicClient({
    chain,
    transport: http()
  });
};
var getChain = (chainId) => {
  switch (chainId) {
    case ChainId5.ARBITRUM_ONE:
      return arbitrum;
    case ChainId5.ARB_GOERLI:
      return arbitrumGoerli;
    case ChainId5.AVALANCHE:
      return avalanche;
    case ChainId5.FUJI:
      return avalancheFuji;
    case ChainId5.BNB_CHAIN:
      return bsc;
    case ChainId5.BNB_TESTNET:
      return bscTestnet;
    case ChainId5.ETHEREUM:
      return mainnet;
  }
};

// src/fetcher.ts
var TOKEN_DECIMALS_CACHE = {};
var Fetcher = class {
  /**
   * Cannot be constructed.
   */
  constructor() {
  }
  /**
   * Fetch information for a given token on the given chain, using the given viem public client.
   * @param chainId chain of the token
   * @param address address of the token on the chain
   * @param client client used to fetch the token
   * @param symbol optional symbol of the token
   * @param name optional name of the token
   */
  static async fetchTokenData(chainId, address, client = getDefaultPublicClient(chainId), symbol, name) {
    var _a;
    const parsedDecimals = typeof ((_a = TOKEN_DECIMALS_CACHE == null ? void 0 : TOKEN_DECIMALS_CACHE[chainId]) == null ? void 0 : _a[address]) === "number" ? TOKEN_DECIMALS_CACHE[chainId][address] : await client.readContract({
      abi: ERC20ABI,
      functionName: "decimals",
      address: getAddress2(address)
    }).then((decimals) => {
      TOKEN_DECIMALS_CACHE = {
        ...TOKEN_DECIMALS_CACHE,
        [chainId]: {
          ...TOKEN_DECIMALS_CACHE == null ? void 0 : TOKEN_DECIMALS_CACHE[chainId],
          [address]: decimals
        }
      };
      return decimals;
    });
    return new Token4(chainId, address, parsedDecimals, symbol, name);
  }
  /**
   * Fetches information about a pair and constructs a pair from the given two tokens.
   * @param tokenA first token
   * @param tokenB second token
   * @param provider the provider to use to fetch the data
   */
  static async fetchPairData(tokenA, tokenB, client = getDefaultPublicClient(tokenA.chainId)) {
    invariant5(tokenA.chainId === tokenB.chainId, "CHAIN_ID");
    const address = Pair.getAddress(tokenA, tokenB, tokenA.chainId);
    const [reserves0, reserves1] = await client.readContract({
      abi: JoePairABI,
      functionName: "getReserves",
      address: getAddress2(address)
    });
    const balances = tokenA.sortsBefore(tokenB) ? [reserves0, reserves1] : [reserves1, reserves0];
    return new Pair(
      new TokenAmount3(tokenA, balances[0]),
      new TokenAmount3(tokenB, balances[1]),
      tokenA.chainId
    );
  }
};

